import { motion } from "framer-motion";

const PageWrapper = ({ children }) => {
  return (
    <motion.div
      initial={{ y: "-100vh" }}
      animate={{ y: 0 }}
      exit={{ y: "-100vh" }}
      transition={{ duration: 0.6, ease: "easeInOut" }}
      style={{ position: "absolute", width: "100%" }}
    >
      {children}
    </motion.div>
  );
};

export default PageWrapper;
